function App() {
  return (
    <div className="App">
      {/* <Form/> */}
      <Router>

      <Routes>
     <Route exact path ='/F' element={<Form/>} component={<Form/>} />
     <Route exact path='/' element={<Sidebar/>} component={<Sidebar/>}/>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
